import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 24.2-109.1 Performance review of general registrars.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-109.1.md","filePath":"vacode/24.2-109.1.md"}'),o={name:"vacode/24.2-109.1.md"},n=t('<h1 id="§-24-2-109-1-performance-review-of-general-registrars" tabindex="-1">§ 24.2-109.1 Performance review of general registrars. <a class="header-anchor" href="#§-24-2-109-1-performance-review-of-general-registrars" aria-label="Permalink to &quot;§ 24.2-109.1 Performance review of general registrars.&quot;">​</a></h1><p>The electoral board shall conduct an annual performance review of the general registrar for years ending June 30, 2006, and thereafter. The electoral board shall complete the review by August 1 of each year, retain a copy of the performance review, and provide a summary of the review to the State Board. The performance review shall be conducted in accordance with the format and forms provided by the State Board.</p><p>2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0027" target="_blank" rel="noreferrer">27</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0391" target="_blank" rel="noreferrer">391</a>; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0235" target="_blank" rel="noreferrer">235</a>.</p>',3),i=[n];function c(l,s,f,d,h,_){return r(),a("div",null,i)}const m=e(o,[["render",c]]);export{p as __pageData,m as default};
